/**
 * NPM Import
 */
import React, { Component } from 'react';
import { Select } from 'antd';
/**
 * LOCAL Import
 */
import './App.css';

/**
 * CODE Here
 */
class App extends Component {

  onChange = value => {
    console.log(`selected ${value}`)
  }

  onBlur = () => {
    console.log('blur')
  }

  onFocus = () => {
    console.log('focus')
  }

  onSearch = (val) => {
    console.log('search:', val)
  }

  render () {
    return (
      <>
        <h1>Hello World</h1>
        <Select
          showSearch
          style={{ width: 200 }}>
        </Select>
      </>
    )
  }
}

 /**
* Export
*/
export default App;
